import Header from "./header";
import Footer from "./fotter"

function App() {
  return (
    <div className="grid grid-cols-4">
    <div className="col-span-4">
      <Header />
      </div>
      <nav className="text-3xl font-bold underline  col-span-1 border">NAv</nav>
      <main className="col-start-1 col-end-4">Main</main>
      <Footer />
    </div>
  );
}

export default App;
